import React from 'react';

function PusherTest() {
  return (
    <div className="PusherTest">
      <h1>Pusher Test</h1>
      <p>
        Try publishing an event to channel <code>my-channel</code>
        with event name <code>my-event</code>.
      </p>
    </div>
  );
}

export default App;
